const result=JSON.parse(document.getElementById("result-data").value);if(result.isError)document.getElementById("result-table").innerText="JSONの解析に失敗しました。フォーマットが不正な可能性があります。";else if(result.length>0){let t="",e=0;result.forEach((l=>{t+=`<div class="result-element"><div class="collapsable-toggle">\n            <a data-bs-toggle="collapse" data-bs-target="#clps${e}" aria-expanded="false" aria-controls="clps${e}">\n            ${l.d} 接触数: ${l.cn} スコア: ${l.ss}</a></div>`,t+=`<div class="collapse" id="clps${e++}">\n            <table><thead><th>No</th><th>接触時間(分)</th><th>最小db</th><th>最大db</th></tr></thead><tbody>`;let a=1;l.cl.forEach((e=>{t+=`<tr><td>${a++}</td><td>${e.cm}</td><td>${e.miad}</td><td>${e.maad}</td></tr>`})),t+="</tbody></table></div></div>"}));const l=document.createElement("div");l.id="result-table",l.insertAdjacentHTML("afterbegin",t),document.getElementById("result-table").replaceWith(l)}